import React from 'react';
import '../App.css';
import'./HomeTopSection.css';
import ParticlesHome from './ParticlesHome'
import Particles from 'react-particles-js';
import "pathseg";


function HomeTopSection() {
    return (
        <div className =  'homeTopSection-container'>
          <Particles
    params={{
	    "particles": {
	        "number": {
	            "value": 50
	        },
	        "size": {
	            "value": 3
	        }
	    },
	    "interactivity": {
	        "events": {
	            "onhover": {
	                "enable": true,
	                "mode": "repulse"
	            }
	        }
	    }
	}} />
          {/* <div className = 'homeParticleSection'>
               <ParticlesHome/>
          </div> */}
            <div className = 'homeLeftSection'>
              <ParticlesHome/>
            </div>
            <div className = 'homeLeftSection'>
                <h1>Just2Connect</h1>
                 <p>BIG TINGS AGWANNNNNN</p>
            </div>
            <div className = 'homeRightSection'>
                                    <h1>Just2Connect</h1>
                 <p>BIG TINGS AGWANNNNNN</p>
            </div>

        </div>
    )
}

export default HomeTopSection
